import React from 'react';
import ReactDOM from 'react-dom';
import * as serviceWorker from './serviceWorker';
import Form from './common/form/main';
serviceWorker.register();

const forminit = {
    id : '',
    method : 'get',
    class : '223',
    token : 'token',
    hash : 'hash',
    cont : {
        name :'123',
        sex :'男',
        reg :'20185568',
    }
};

ReactDOM.render(<Form forminit={forminit} />, document.getElementById('app'));

serviceWorker.unregister();
